// Some functions based off of fair-atomic-swap/src/atomicswap/eip2266/ERC2266Swap.sol
// Copyright (c) 2019 Chris Haoyu LIN, Runchao HAN, Jiangshan YU
// SPDX-License-Identifier: UNLICENSED

// todo: fix all states to be different names

pragma solidity ^0.8.10;

import "./libraries/token/ERC20/ERC20.sol";

contract ApricotSwap {

    /**
        We will manipulate the DELTA variable (seconds) to see how sucessful the monitor is
     */

    uint constant DELTA = 20; //TODO: choose your DELTA
    uint constant numParticipants = 3;
    uint constant numLeaders = 1;
    uint constant numEdges = 3;
    uint constant maxNumPaths = 1;
    uint constant maxPathLength = 3;
    /**
     * Mappings that store our swap details.
     */
    mapping(bytes32 => bool) hashkeyRedeemed;
    mapping(bytes32 => Swap) public swaps;
    mapping(bytes32 => Escrow) public escrows;
    mapping(bytes32 => EscrowPremium) public escrowPremiums;
    mapping(bytes32 => RedemptionPremium) public redemptionPremiums;

    //store
    struct Swap {
        bytes32[numLeaders] leaderPremiumHashLock;
        bytes32[numLeaders] leaderEscrowHashLock;
        address assetName;
        int32 timeout;
        bool[6] stepsTaken;
        address sender;
        address receiver;
    }

    /**
     * The Escrow struct keeps track of the escrowed Asset
     */
    struct Escrow {
        //type of asset
        uint expected;
        uint current;
        //the deadline is for escrowing
        uint deadline;
        //the timeout is for redeeming
        uint timeout;
    }

    /**
     * The Premium struct keeps track of the deposited premium.
     */
    struct EscrowPremium {
        uint expected;
        uint current;
        uint deadline;
        uint timeout;
    }

    struct RedemptionPremium {
        bytes32 hashlock;
        uint expected;
        uint current;
        uint deadline;
        uint timeout;
        address[numParticipants] path;

    }

////// event interfaces are defined as below

    event SetUp(
        uint timestamp,
        uint startTime,
        bytes32 escrowHashLock,
        bytes32 premiumHashLock,
        address payable sender,
        address payable reciever
    );

    event EscrowPremiumDeposited(
        uint timestamp,
        uint premiumAmount
    );
    event RedemptionPremiumDeposited(
        uint timestamp,
        uint premiumAmount,
        address[numParticipants] path
    );  

    event AssetEscrowed (
        uint timestamp,
        uint assetAmount
    );



    event EscrowPremiumRefunded(
        uint timestamp,
        uint amountRefunded
    );

    event EscrowPremiumRedeemed(
        uint timestamp,
        uint amountRedeemed
    );

    event RedemptionPremiumRedeemed(
        uint timestamp,
        uint amountRedeemed

    );
    event RedemptionPremiumRefunded(
        uint timestamp,
        uint amountRefunded
    );

    event AssetRedeemed(
        uint timestamp,
        uint amountRedeemed
    );

    event AssetRefunded(
        uint timestamp,
        uint amountRefunded
    );


//// modifiers below


    modifier canSetup(bytes32 escrowHashLock) {
        //require(swaps[escrowHashLock].stepsTaken[0] == false);
        _;
    }
    modifier canDepositEscrowPremium(bytes32 escrowHashLock){
        require(msg.sender == swaps[escrowHashLock].sender);
        require(swaps[escrowHashLock].stepsTaken[0] == true && swaps[escrowHashLock].stepsTaken[1] == false);
        require(ERC20(swaps[escrowHashLock].assetName).balanceOf(msg.sender) >= escrowPremiums[escrowHashLock].expected);
        require(block.timestamp <= escrowPremiums[escrowHashLock].deadline, "did not deposit escrow premium in time");
        _;
    }
    modifier canDepositRedemptionPremium(bytes32 escrowHashLock, bytes32 premiumHashLock, bytes32 preimage, address[maxPathLength] calldata path){
        require(msg.sender == swaps[escrowHashLock].receiver);
        require(swaps[escrowHashLock].stepsTaken[1] == true && swaps[escrowHashLock].stepsTaken[2] == false);
        require(sha256(abi.encode(preimage)) == swaps[escrowHashLock].leaderPremiumHashLock[0]);
        require(ERC20(swaps[escrowHashLock].assetName).balanceOf(msg.sender) >= redemptionPremiums[escrowHashLock].expected);
        require(block.timestamp <= redemptionPremiums[escrowHashLock].deadline, "did not deposit redemption premium in time");
        _;
    }
    modifier canEscrowAsset(bytes32 escrowHashLock) {
        require(msg.sender == swaps[escrowHashLock].sender);
        require(swaps[escrowHashLock].stepsTaken[2] == true && swaps[escrowHashLock].stepsTaken[3] == false);
        require(ERC20(swaps[escrowHashLock].assetName).balanceOf(msg.sender) >= escrows[escrowHashLock].expected);
        require(block.timestamp <= escrows[escrowHashLock].deadline, "did not escrow asset in time");
        _;
    }
    modifier canUnlockHashLock(bytes32 escrowHashLock, bytes32 preimage, address[maxPathLength] memory path)
    {
        require(msg.sender == swaps[escrowHashLock].sender);
        require(swaps[escrowHashLock].stepsTaken[4] == false && swaps[escrowHashLock].stepsTaken[2] == true);
        //require the hashlock has not been unlocked and that there has been a redemption premium deposited
        require(block.timestamp <= redemptionPremiums[escrowHashLock].timeout, "did not escrow premium in time");
        require(sha256(abi.encode(preimage)) == swaps[escrowHashLock].leaderEscrowHashLock[0]);
        address[maxPathLength] memory stored_path = redemptionPremiums[escrowHashLock].path;
        for(uint i = 0; i < maxPathLength; i++)
        {
            require(stored_path[i] == path[i]);
        }
        _;
    }
    modifier canRedeemAsset(bytes32 escrowHashLock) {
        require(msg.sender == swaps[escrowHashLock].receiver);
        require(swaps[escrowHashLock].stepsTaken[4] == true);
        require(block.timestamp <= escrows[escrowHashLock].timeout);
        _;
    }

    modifier canRefundAsset(bytes32 escrowHashLock) {
        require(msg.sender == swaps[escrowHashLock].sender);
        require(swaps[escrowHashLock].stepsTaken[3] == true, "Asset not escrowed");
        require(swaps[escrowHashLock].stepsTaken[4] == false, "Already redeemed asset");
        require(block.timestamp > escrows[escrowHashLock].timeout);
        //if the asset is escrowed and the timeout has passed, allow them to get their asset back
        _;
    }


    modifier canRedeemEscrowPremium(bytes32 escrowHashLock) {
        require(msg.sender == swaps[escrowHashLock].receiver);
        require(swaps[escrowHashLock].stepsTaken[2] == true);
        require(swaps[escrowHashLock].stepsTaken[1] == true);
        require(swaps[escrowHashLock].stepsTaken[3] == false);
        require(block.timestamp > escrows[escrowHashLock].deadline);
        _;
    }

    modifier canRedeemRedemptionPremium(bytes32 escrowHashLock) {
        require(msg.sender == swaps[escrowHashLock].sender);
        require(swaps[escrowHashLock].stepsTaken[2] == true);//Redemption Premium Deposited
        require(swaps[escrowHashLock].stepsTaken[4] == false); //Asset not redeemed
        require(block.timestamp > redemptionPremiums[escrowHashLock].timeout);
        _;
    }
    modifier canRefundEscrowPremium(bytes32 escrowHashLock) {
        require(msg.sender == swaps[escrowHashLock].sender);
        require((block.timestamp > escrowPremiums[escrowHashLock].deadline && swaps[escrowHashLock].stepsTaken[2] == false) 
                || (swaps[escrowHashLock].stepsTaken[3] == true));
                //Allow refund to the sender if the deadline passed and the receiver did not post a redemption premium or if the asset has been escrowed
        _;
    }
    modifier canRefundRedemptionPremium(bytes32 escrowHashLock) {
        require(msg.sender == swaps[escrowHashLock].receiver);
        require(swaps[escrowHashLock].stepsTaken[4] == true);
        _;
    }

    function getPathLength(address[maxPathLength] calldata path) private pure returns (uint16)
    {
        uint16 length = 0;
        for(uint16 i = 0; i < maxPathLength; i++)
        {
            if(path[i] == address(0))
            {
                break;
            }
            length += 1;
        }
        return length;
    }

    function setup(uint expectedEscrowAmount,
                    uint expectedEscrowPremiumAmount,
                    address payable sender,
                    address payable receiver,
                    address assetName,
                    bytes32 escrowHashLock,
                    bytes32 premiumHashLock,
                    uint startTime,
                    address[numParticipants] calldata path
                    )
        public payable canSetup(escrowHashLock) {
        //set up swap mapping
        swaps[escrowHashLock].assetName = assetName;
        swaps[escrowHashLock].stepsTaken[0] = true;
        swaps[escrowHashLock].sender = sender;
        swaps[escrowHashLock].receiver = receiver;
        swaps[escrowHashLock].leaderPremiumHashLock[0] = premiumHashLock;
        swaps[escrowHashLock].leaderEscrowHashLock[0] = escrowHashLock;

        //set up escrow mapping
        escrows[escrowHashLock].expected = expectedEscrowAmount;
        escrows[escrowHashLock].deadline = startTime + 7 * DELTA;
        escrows[escrowHashLock].timeout = startTime + 12 * DELTA;

        //set up premium mapping
        escrowPremiums[escrowHashLock].expected = expectedEscrowPremiumAmount;
        escrowPremiums[escrowHashLock].deadline = startTime + 1 * DELTA;    
        escrowPremiums[escrowHashLock].timeout = startTime + 7 * DELTA;

        redemptionPremiums[escrowHashLock].path = path;
        redemptionPremiums[escrowHashLock].expected = 4-getPathLength(path);//1,2,3, the cost
        redemptionPremiums[escrowHashLock].deadline = startTime + (3+getPathLength(path))* DELTA;//TODO: fix that later
        redemptionPremiums[escrowHashLock].timeout = startTime + (9+getPathLength(path))* DELTA;//TODO: fix that later;    
        
        emit SetUp(
            block.timestamp,
            startTime,
            escrowHashLock,
            premiumHashLock,
            sender, receiver
        );
    }
    function depositEscrowPremium(bytes32 escrowHashLock) public payable canDepositEscrowPremium(escrowHashLock)
    {
        ERC20(swaps[escrowHashLock].assetName).transferFrom(swaps[escrowHashLock].sender, address(this), escrowPremiums[escrowHashLock].expected);
        escrowPremiums[escrowHashLock].current = escrowPremiums[escrowHashLock].expected;
        swaps[escrowHashLock].stepsTaken[1] = true;

        emit EscrowPremiumDeposited(
            block.timestamp,
            escrowPremiums[escrowHashLock].current
        );
    }

    function depositRedemptionPremium(bytes32 escrowHashLock, bytes32 premiumHashLock, bytes32 preimage, address[maxPathLength] calldata path) public payable canDepositRedemptionPremium(escrowHashLock, premiumHashLock, preimage, path)
    {
        ERC20(swaps[escrowHashLock].assetName).transferFrom(swaps[escrowHashLock].receiver, address(this), redemptionPremiums[escrowHashLock].expected);
        redemptionPremiums[escrowHashLock].current = redemptionPremiums[escrowHashLock].expected;
        swaps[escrowHashLock].stepsTaken[2] = true;

        emit RedemptionPremiumDeposited(
            block.timestamp,
            redemptionPremiums[escrowHashLock].current,
            path
        );
    }

    function escrowAsset(bytes32 escrowHashLock) public payable canEscrowAsset(escrowHashLock) {
        ERC20(swaps[escrowHashLock].assetName).transferFrom(swaps[escrowHashLock].sender, address(this), escrows[escrowHashLock].expected);
        escrows[escrowHashLock].current = escrowPremiums[escrowHashLock].expected;
        swaps[escrowHashLock].stepsTaken[3] = true;
        refundEscrowPremium(escrowHashLock);
        emit AssetEscrowed(
            block.timestamp,
            escrows[escrowHashLock].current
        );
    }


    function unlockHashlock(bytes32 escrowHashLock, bytes32 preimage, address[maxPathLength] calldata path) public payable canUnlockHashLock(escrowHashLock, preimage, path)
    {      
        swaps[escrowHashLock].stepsTaken[4] = true;
        if(swaps[escrowHashLock].stepsTaken[2]==true)
        {
            refundRedemptionPremium(escrowHashLock);
        }
        // we need to call refundredemptionpremium to get back the corresponding redemption premium

        if(swaps[escrowHashLock].stepsTaken[3]==true)
        {
            redeemAsset(escrowHashLock);
        }

    }

    function redeemAsset(bytes32 escrowHashLock) public payable canRedeemAsset(escrowHashLock) {
        ERC20(swaps[escrowHashLock].assetName).transferFrom(address(this), swaps[escrowHashLock].receiver, escrows[escrowHashLock].current);
        emit AssetRedeemed(
            block.timestamp,
            escrows[escrowHashLock].current
        );
        escrows[escrowHashLock].current = 0;
    }

    function refundAsset(bytes32 escrowHashLock) public canRefundAsset(escrowHashLock) {
        ERC20(swaps[escrowHashLock].assetName).transferFrom(address(this), swaps[escrowHashLock].sender, escrows[escrowHashLock].current);
        emit AssetRefunded(
            block.timestamp,
            escrows[escrowHashLock].current
        );
        escrows[escrowHashLock].current = 0;
    }

    function redeemEscrowPremium(bytes32 escrowHashLock) public canRedeemEscrowPremium(escrowHashLock){
        ERC20(swaps[escrowHashLock].assetName).transferFrom(address(this), swaps[escrowHashLock].receiver, escrowPremiums[escrowHashLock].current);
        emit EscrowPremiumRedeemed(
            block.timestamp, 
            escrowPremiums[escrowHashLock].current
        );
        escrowPremiums[escrowHashLock].current = 0;
    }
    ///
    function refundEscrowPremium(bytes32 escrowHashLock) public payable canRefundEscrowPremium(escrowHashLock){
        ERC20(swaps[escrowHashLock].assetName).transferFrom(address(this), swaps[escrowHashLock].sender, escrowPremiums[escrowHashLock].current);
        emit EscrowPremiumRefunded(
            block.timestamp,
            escrowPremiums[escrowHashLock].current
        );
        escrowPremiums[escrowHashLock].current = 0;
    }

    function redeemRedemptionPremium(bytes32 escrowHashLock) public canRedeemRedemptionPremium(escrowHashLock){
        ERC20(swaps[escrowHashLock].assetName).transferFrom(address(this), swaps[escrowHashLock].sender, redemptionPremiums[escrowHashLock].current);
        emit RedemptionPremiumRedeemed(
            block.timestamp,
            redemptionPremiums[escrowHashLock].current
        );
        redemptionPremiums[escrowHashLock].current = 0;
    }

    function refundRedemptionPremium(bytes32 escrowHashLock) public payable canRefundRedemptionPremium(escrowHashLock){
        ERC20(swaps[escrowHashLock].assetName).transferFrom(address(this), swaps[escrowHashLock].receiver, redemptionPremiums[escrowHashLock].current);
        emit RedemptionPremiumRefunded(
            block.timestamp,
            redemptionPremiums[escrowHashLock].current
        );
        redemptionPremiums[escrowHashLock].current = 0;
    }
}
